    Входные данные: строка числа n (3 ≤ n ≤ 2 * 10^5) — количество вершин в дереве, 
    на одной строке разделено ровно n - 1 числа от 1 до n (1 ≤ a_i, b_i ≤ n, a_i ≠ b_i). 
    Данные гарантируют, что граф является треугольным невзвешенным неупорядоченным 
    (несвязным) графом.

    Функция возвращает решение задачи о выборе трех различных узлов для построения самого большого общего пути.
    Выходные данные: строка с тремя числами a, b, c (1 ≤ a, b, c ≤ n) или "?" или "?" или "?" или "?".
    Если выбраны три различных узла, то выводится решение данной задачи: тройка чисел a, b, c 
    или любая из них. Если существует несколько решений данной задачи, то выводится 
    любой из них.
    '''

