    edges = [list(map(int, input().split())) for _ in range(n-1)]
    graph = {u: set() for u in range(1, n+1)}

    for u, v in edges:
        graph[u].add(v)
        graph[v].add(u)

    num = max_edges = 0
    max_paths = []

    for u in range(1, n+1):
        for v in range(u+1, n+1):
            paths = set()
            for i in range(u):
                if i not in graph[v]:
                    break
                for j in range(i+1, v):
                    if j not in graph[u]:
                        break
                    paths.add((i, j, v))

            if len(paths) > max_edges:
                max_edges = len(paths)
                max_paths = paths
                num = u

    if len(max_paths) == 1:
        print(*max_paths.pop())
    else:
        print('?')
    return ''

