        1. Divides the element by 2.
        2. If the value of the element is even, we keep that value.
        3. Else, we keep the value, divided by 2, rounded down.

    The minimum value for the operation is the maximum value for the element.

    We count how many times we have to divide the element and add the value of the
    maximum divided element.
