    """Return the solution string."""
    # Parse the input
    (n, m, x) = [int(i) for i in stdin.split()]
    tolls = [int(i) for i in stdin.split()]

    # Check if X is in the range of n.
    if x < 0 or x >= n:
        raise ValueError('X is not in the range of n.')

    # Check if all values in the tolls are between n.
    for i in tolls:
        if i < 0 or i >= n:
            raise ValueError('Not all values in tolls are in the range of n.')

    # Check if there is a toll gate in Square 0 or Square X or Square N.
    if 0 in tolls:
        raise ValueError('Square 0 has a toll gate in it.')
    if x in tolls:
        raise ValueError('Square X has a toll gate in it.')
    if n in tolls:
        raise ValueError('Square N has a toll gate in it.')

    # Create the graph
    graph = {i: [] for i in range(n)}

    # Add edges to the graph
    for i in range(m):
        (src, dst) = [int(i) for i in stdin.split()]
        graph[src].append(dst)
        graph[dst].append(src)

    # Create the costs for each path
    costs = {i: [1 for i in range(n)] for i in range(n)}

    # Check each edge to see which cost is better
    for src in range(n):
        for dst in graph[src]:
            if costs[src][dst] > 1:
                costs[src][dst] = costs[src][dst] + 1

    # Initialize the queue
    queue = []
    queue.append([x, 0])

    # Enqueue the nodes in the queue
    for node in graph[x]:
        queue.append([node, 1])

    # Initialize the visited set
    visited = {x}

    # DFS
    while queue:
        curr = queue.pop()
        if curr[0] == 0 or curr[0] == n:
            return curr[1]
        for node in graph[curr[0]]:
            if node not in visited:
                visited.add(node)
                queue.append([node, curr[1] + 1])
    return -1

