    n, m = list(map(int, stdin.split(' ')))
    grid = [input().strip() for _ in range(n)]

    # Find position of all '#' and '.'
    pos = []
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '#':
                pos.append((i, j))
            if grid[i][j] == '.':
                pos.append((i, j))

    def dfs(x: int, y: int) -> bool:
        if grid[x][y] == '#':
            return False
        if grid[x][y] == 'E':
            return True
        grid[x][y] = 'E'
        if dfs(x, y - 1):
            if dfs(x, y + 1):
                if dfs(x + 1, y):
                    if dfs(x - 1, y):
                        return True
        return False

    count = 0
    for i, j in pos:
        if dfs(i, j):
            count += 1

    return '\n'.join([''.join(i) for i in grid]) + f'\n{count}'

